import React, { Component } from 'react';
import { Card, CardTitle, CardActions, CardText, Button, CardMenu, IconButton } from 'react-mdl';

class About extends Component {
    render() {
        return(
            <div className="aboutme-div">
            <Card className="aboutme-card"shadow={0} style={{width: '1012px', margin: 'auto'}}>
                <CardTitle style={{color: '#fff', height: '176px', background: 'url(http://www.getmdl.io/assets/demos/welcome_card.jpg) center / cover'}}>Welcome to My Portfolio Page</CardTitle>
                <CardText>
                    My name is Kyle and I am a recent graduate from San Diego State University with a B.S. in Computer Science.
                    Additionally, I have 3 years of Information Technology Support experience in the public sector. I enjoy 
                    tinkering and creating projects such as this website and my personal home-lab which this website is run on.
                    If you would like to get in touch with me, please do not hesitate to click the button below for my contact :). 
                </CardText>
                <CardActions border>
                    <Button colored>Contact</Button>
                </CardActions>
            </Card>
            </div>
        )
    }
}

export default About;
